const AlbumPhotos = (props) =>{

    return(
        <div className="photos">
            Photos
            {props.data.map((element, index) =>(
             <div className="photo" key={index}>
                <h3>{element.title}</h3>
                <img src={element.thumbnailUrl} alt=""/>
              </div>

            ))}
        </div>
    )

 };

export default AlbumPhotos
